import React, {useState, Fragment} from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import "./App.css";
import "./style.css";
import search from "./request.js";
import Header from "./components/Header.js";
import Results from "./components/Results";

function App() {

  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />}></Route>
          <Route path="/about" element={<Home />}></Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;

function Home() {

  const [data, update] = useState({item: "", results: [], });

  const searchItem = async (i) => {
    const value = await search(i);
    console.log(value);
    update({item: i, results: value});
  };

  return (
  <Fragment>
    <nav>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/about">About</Link></li>
        </ul>
      </nav>
    <Header searchItem={searchItem}/>
    <Results item={data.item} results={data.results}/>
  </Fragment>
  );
}

const About = () => (
  <Fragment>
    <h1>About</h1>
    <FakeText />
  </Fragment>
  );
